import '../../css/FormSectionRouting.css';
import { Routes, Route } from 'react-router-dom';
import SignUp from './SignUp';
import Login from './Login';
import ForgotPassword from './ForgotPassword';

function FormSectionRouting() {
    return(
        <div>

            <Routes>
              <Route className = "login"> <Login/> </Route>
            </Routes>
            <Routes>
              <Route className = "forgotPassword"> <ForgotPassword/> </Route>
            </Routes>
        </div>
    );
}
export default FormSectionRouting;
